import { useState, useEffect } from 'react';
import  ReactDOM  from 'react-dom';
import './dropDown.css';
import './dropDownBreak.css';

const DropDown = ()=>{
    return(
        <div className="dropdown">
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Skills</li>
                <li>Contact</li>
            </ul>
        </div>
    );
}

export default DropDown;
